<?php

namespace Database\Seeders;

use App\Models\admin;
use App\Models\BusinessType;
use App\Models\Catagory;
use App\Models\Country;
use App\Models\Product;
use App\Models\ProductImage;
use App\Models\ProductVarient;
use App\Models\Seller;
use App\Models\SubCatagory;
use App\Models\UnitWeight;
use App\Models\WholesalePrice;
use Database\Factories\SellerFactory;
use Faker\Factory;
use Illuminate\Database\Console\Seeds\WithoutModelEvents;
use Illuminate\Database\Seeder;
use Illuminate\Support\Facades\Hash;
use Illuminate\Support\Facades\Storage;
use Illuminate\Support\Str;
use Intervention\Image\Facades\Image;

class SellerSeeder extends Seeder
{
    /**
     * Run the database seeds.
     *
     * @return void
     */
    public function run()
    {


        admin::create([
            "name"=>"salauddin@gmail.com",
            "email"=>"salauddin@gmail.com",
            "password"=>Hash::make("123456")
        ]);

        BusinessType::factory()->count(10)->create();


        //Country
        $name=["Bangladesh","India","Pakistan","China","America","Japan"];
        $code=["+880","+91","+92","+86","+1","+81"];
        $flag=[
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,"];

            for($a=0; $a<count($name); $a++){

                list($type, $imageData) = explode(';', $flag[$a]);
                list(,$extension) = explode('/',$type);
                list(,$imageData)      = explode(',', $imageData);
                $fileName = uniqid().'.'.$extension;
                $imageData = base64_decode($imageData);

                Storage::disk("public")->put("logo/".$fileName,$imageData);

                Country::create([
                    "name"=>$name[$a],
                    "code"=>$code[$a],
                    "flag"=>$fileName,
                    "dollar_rate"=>80,
                    "currency_type"=>"BDT"
                ]);

            }



        //Seller Create
         Seller::factory()->count(10)->create();

        //Create Catagory
        for($a=0; $a<10; $a++){
            list($type, $imageData) = explode(';', "data:image/png;base64,");
            list(,$extension) = explode('/',$type);
            list(,$imageData)      = explode(',', $imageData);
            $fileName = uniqid().'.'.$extension;
            $imageData = base64_decode($imageData);

            Storage::disk("public")->put("catagory/".$fileName,$imageData);
            Catagory::create([
                "catagory_name"=>Str::random(12),
                "catagory_img"=>$fileName
            ]);
        }

        //Sub Catagory
        for($a=0; $a<10; $a++){
            list($type, $imageData) = explode(';', "data:image/png;base64,");
            list(,$extension) = explode('/',$type);
            list(,$imageData)      = explode(',', $imageData);
            $fileName = uniqid().'.'.$extension;
            $imageData = base64_decode($imageData);

            Storage::disk("public")->put("sub-catagory/".$fileName,$imageData);
            SubCatagory::create([
                "catagory_id"=>1,
                "sub_catagory_name"=>Str::random(12),
                "sub_catagory_img"=>$fileName
            ]);
        }



        //Unit Weights

        $unit_weights=["KG","GRM","LITR","ML"];

        foreach($unit_weights as $value){
            UnitWeight::create([
                "unit_name"=>$value
            ]);
        }





        //Add Product Varient

      for($a=0; $a<10;$a++){
          list($type, $imageData) = explode(';', "data:image/png;base64,");
          list(,$extension) = explode('/',$type);
          list(,$imageData)      = explode(',', $imageData);
          $fileName = uniqid().'.'.$extension;
          $imageData = base64_decode($imageData);

          Storage::disk("public")->put("varients/".$fileName,$imageData);

          ProductVarient::create([
              "user_id"=>1,
              "name"=>Str::random(12),
              "color"=>$fileName,
              "varients"=>json_encode([
                  [
                      "size"=>"21-inch 8/256",
                      "color"=>"red",
                      "stock"=>20
                  ],
                  [
                      "size"=>"21-inch 16/256",
                      "color"=>"red",
                      "stock"=>33
                  ],
                  [
                      "size"=>"21-inch 16/500",
                      "color"=>"red",
                      "stock"=>3434
                  ]
              ])
          ]);
      }


      //Add Product

        for($a=0; $a<10; $a++){
            $product_insert=Product::create([
                "seller_id"=>1,
                "product_name"=>Factory::create()->name,
                "catagory_id"=>1,
                "sub_catagory_id"=>1,
                "product_details"=>Factory::create()->text,
                "product_code"=>Str::random(5),
                "video_url"=>"https://www.youtube.com",
                "product_origin"=>"US",
                "weight_unit"=>500,
                "weight_type"=>"KG",
                "is_active"=>1,
            ]);


            $wholesale_price=[
                [
                    "min_quantity"=>10,
                    "max_quantity"=> 20,
                    "amount"=>200,
                    "unit"=>"KG"
                ],
                [
                    "min_quantity"=>10,
                    "max_quantity"=>20,
                    "amount"=>200,
                    "unit"=>"KG"
                ]];
            for($i=0; $i<count($wholesale_price); $i++){
                $insert_wholesale_prices=WholesalePrice::insert([
                    "product_id"=>$product_insert->id,
                    "min_quantity"=>$wholesale_price[$i]["min_quantity"],
                    "max_quantity"=>$wholesale_price[$i]["max_quantity"],
                    "amount"=>$wholesale_price[$i]["amount"],
                    "unit"=>$wholesale_price[$i]["unit"],
                ]);
            }

            $product_varient=[1,2];

            for($i=0; $i<count($product_varient); $i++){
                ProductVarient::where(["id"=>$product_varient[$i]])->update([
                    "product_id"=>$a+1
                ]);
            }




            $image=["data:image/png;base64,","data:image/png;base64,","data:image/png;base64,","data:image/png;base64,"];
            for($b=0; $b<count($image); $b++){

                list($type, $imageData) = explode(';', $image[$b]);
                list(,$extension) = explode('/',$type);
                list(,$imageData)      = explode(',', $imageData);
                $fileName = uniqid().'.'.$extension;
                $imageData = base64_decode($imageData);
                $imageData=str_replace("data:image/png;base64,","",$imageData);


                $compressedImage = Image::make($imageData)
                    ->resize(800, null, function ($constraint) {
                        $constraint->aspectRatio();
                        $constraint->upsize();
                    })
                    ->encode("png", 20); // 75 is the quality percentage


                Storage::disk("public")->put("products/".$fileName,$compressedImage);


                $id= ProductImage::insertGetId([
                    "product_id"=>$b+1,
                    "img"=>$fileName
                ]);

            }

        }


    }
}
